import React from 'react';
import './App.css';

import HomePage from './pages/homepage/homepage';
import Bio from './pages/bio/bio';
import Contact from '.pages/contact/contact';

function App() {
  return (
    <div>
        <HomePage />
        <Bio />
        <Contact />
    </div>
  );
}

export default App;
